/* This example requires Tailwind CSS v2.0+ */
import { Fragment } from 'react'
import { Disclosure, Menu, Transition } from '@headlessui/react'
import { BellIcon, MenuIcon, XIcon } from '@heroicons/react/outline'

const navigation = [
  { name: 'Dashboard', href: '#', current: true },
  { name: 'Team', href: '#', current: false },
  { name: 'Projects', href: '#', current: false },
  { name: 'Calendar', href: '#', current: false },
]

function classNames(...classes) {
  return classes.filter(Boolean).join(' ')
}

export default function Example() {
  return (
    <div className='bg-teal-800 flex p-3'>
      <div >
        <a className='text-2xl font-semibold text-white'>Muzamil Haq</a>
      </div>
      <div className='flex items-center pl-3'>
        <a className='text-gray-300 bg-teal-500 hover:bg-gray-700 hover:text-white px-3 mx-1 py-2 rounded-md text-sm font-medium'>Bio</a>
        <a className='text-gray-300 bg-teal-500 hover:bg-gray-700 hover:text-white px-3 mx-1 py-2 rounded-md text-sm font-medium'>What I Made</a>
      </div>
    </div>
  )
}
